import Slide from './components/slider/Slide';
import Home from './pages/Home';
import Products from './pages/Products';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <>
      <Home />
      {/* <Products /> */}
      {/* <Slide /> */}

      <BrowserRouter >
        <Switch>

        <Route exact path="/pokemon">
        <Header/>
            <Home/>
          </Route>
</Switch>
</BrowserRouter>
    </>
  );
}

export default App;
